fn main() {
    assert_eq!(Solution::is_subsequence("abc".to_string(), "ahbgdc".to_string()), true);
    assert_eq!(Solution::is_subsequence("axc".to_string(), "ahbgdc".to_string()), false);
    assert_eq!(Solution::is_subsequence("acb".to_string(), "ahbgdc".to_string()), false);
    assert_eq!(Solution::is_subsequence("ab".to_string(), "baab".to_string()), true);
    assert_eq!(Solution::is_subsequence("leeeeetcode".to_string(), "".to_string()), true);
}

pub struct Solution{}
impl Solution {
    pub fn is_subsequence(s: String, t: String) -> bool {
        let mut result = t.chars().collect::<Vec<_>>();
        let mut i = 0;
        for c in t.chars() {
            if s.chars().nth(i) == Some(c) {
                i += 1;
            } else {
                result.remove(i);
                if i >= s.len() {
                    return result.iter().collect::<String>().contains(&s);
                }
            }
        }
        return result.iter().collect::<String>().contains(&s);
    }
}
